import { useState } from 'react'
import './App.scss';
import Form from './components/Form/Form'
import TodoList from './components/TodoList/'
function App() {

  return (
    <div className="App">
      <header className="App-header">
      <div className="App-header-box">
          <Form/>
          <TodoList/>
      </div>
      </header>
    </div>
  );
}

export default App;
